import { useState } from 'react';
import { Form, Input } from 'semantic-ui-react';

const VideoForm = () => {
    const [name, setName] = useState('');
    return ( 
        <Form>
            <Form.Field>
                <Input placeholder="video name" value={name} onChange={e => setName(e.target.value)}/>
            </Form.Field>
        </Form>
     );
}
 
export default VideoForm;
